import "./Card.css";
import React from "react";
import bitcoin from "./bitcoin.png"

const Card = () =>{

    return(
        <div className="card-container">
            <div className="card-holder">

                
            </div>
            <div className="card-image">
                <img src={bitcoin}/>
            </div>
            <div className="card-details">
                <ul>
                    <li>Name</li>
                    <li>Price</li>
                    <li>Current</li>
                </ul>
            </div>
            
        </div>
    )
}

export default Card;
